/* eslint-disable react/prop-types */
import axios from "axios";
import {
  createContext,
  useContext,
  useEffect,
  useMemo,
  useReducer,
} from "react";
import { getShortestPath } from "../services/apiShortestPath";

const BASE_URL = "http://localhost:5000/api/get/";
const MapContext = createContext();

const initialState = {
  graph: {}, // for storing the graph
  initialGraph: {}, // for resetting the graph
  paths: [],
  distance: 0,
  otherPaths: {},
  obstacles: [],
  blockedEdges: [],
  message: "",
  error: "",
  isLoading: "",
  isInsertPressed: false,
  selectedFeature: "Interactive Map",
  base64map: "",
  mapImage: "",
  currentLocation: "",
  destination: "",
};

function reducer(state, action) {
  switch (action.type) {
    case "loading":
      return { ...state, isLoading: true };

    case "map/loaded":
      return {
        ...state,
        isLoading: false,
        graph: action.payload.graph,
        initialGraph: JSON.parse(JSON.stringify(action.payload.graph)),
        blockedEdges: action.payload.blockedEdges,
        message: action.payload.message,
      };

    case "rejected":
      return { ...state, isLoading: false, error: action.payload };

    case "insert/pressed":
      return { ...state, isInsertPressed: true };

    case "insert/released":
      return { ...state, isInsertPressed: false };

    case "obstacle/insert": {
      const { obstaclePosition, blockedEdgeIndex } = action.payload;
      const updatedGraph = { ...state.graph };
      const updatedBlockedEdges = [...state.blockedEdges, blockedEdgeIndex];

      for (const node in updatedGraph) {
        for (const edge in updatedGraph[node]) {
          if (updatedBlockedEdges.includes(updatedGraph[node][edge])) {
            delete updatedGraph[node][edge];
          }
        }
      }

      return {
        ...state,
        graph: updatedGraph,
        blockedEdges: updatedBlockedEdges,
        obstacles: [...state.obstacles, obstaclePosition],
      };
    }

    case "obstacle/add":
      return { ...state, obstacles: [...state.obstacles, action.payload] };

    case "obstacle/remove":
      return { ...state, obstacles: [], blockedEdges: [] };

    case "path/loaded":
      return {
        ...state,
        paths: action.payload.paths,
        distance: action.payload.distance,
        otherPaths: action.payload.otherPaths,
      };

    case "path/update":
      return {
        ...state,
        paths: action.payload.paths,
        distance: action.payload.distance,
      };

    case "path/reset":
      return { ...state, paths: [] };

    case "path/error":
      return { ...state, error: action.payload };

    case "currentLocation/updated":
      return { ...state, currentLocation: action.payload };

    case "destination/updated":
      return { ...state, destination: action.payload };

    case "feature/selected":
      return {
        ...state,
        selectedFeature: action.payload,
      };

    case "base64/encoded":
      return { ...state, base64map: action.payload };

    case "mapImage/updated":
      return { ...state, mapImage: action.payload };

    case "reset":
      if (state.selectedFeature === "Dynamic Map") {
        return {
          ...state,
          paths: [],
          obstacles: [],
          currentLocation: "",
          destination: "",
        };
      } else {
        return {
          ...initialState,
          graph: JSON.parse(JSON.stringify(state.initialGraph)),
          initialGraph: JSON.parse(JSON.stringify(state.initialGraph)),
          mapImage: state.mapImage,
          selectedFeature: state.selectedFeature,
        };
      }

    default:
      return new Error("Unknown Action");
  }
}

function MapProvider({ children }) {
  const [
    {
      graph,
      paths,
      otherPaths,
      message,
      error,
      isLoading,
      isInsertPressed,
      blockedEdges,
      obstacles,
      base64map,
      mapImage,
      selectedFeature,
      currentLocation,
      destination,
      distance,
    },
    dispatch,
  ] = useReducer(reducer, initialState);
  // console.log("graph", graph);
  // console.log("blockedEdges", blockedEdges);
  // console.log(distance);

  useEffect(
    function () {
      // console.log(currentLocation, destination);
      async function fetchMap() {
        dispatch({ type: "loading" });
        console.log(base64map ? "base64" : "nada");

        try {
          const base64 =
            "";
          const res = await axios.post(`${BASE_URL}map_graph`, {
            base64EncodedMap: base64map ? base64map : base64,
          });
          const data = res.data;
          // console.log(data);
          dispatch({
            type: "map/loaded",
            payload: {
              graph: data.data.graph,
              blockedEdges: data.data.blockedEdges,
              message: data.data.message,
            },
          });

          if (base64map && currentLocation && destination) {
            console.log("huh?");
            await getShortestPath(
              currentLocation,
              destination,
              data.data.graph,
              dispatch,
            );
          }
        } catch (error) {
          dispatch({ type: "rejected", payload: error });
        }
      }
      fetchMap();
    },
    [base64map],
  );

  const value = useMemo(
    () => ({
      graph,
      paths,
      otherPaths,
      blockedEdges,
      obstacles,
      message,
      error,
      isLoading,
      isInsertPressed,
      selectedFeature,
      base64map,
      mapImage,
      dispatch,
      currentLocation,
      destination,
      distance,
    }),
    [
      graph,
      paths,
      otherPaths,
      blockedEdges,
      obstacles,
      message,
      error,
      isLoading,
      isInsertPressed,
      selectedFeature,
      base64map,
      mapImage,
      currentLocation,
      destination,
      distance,
    ],
  );

  return <MapContext.Provider value={value}>{children}</MapContext.Provider>;
}

function useMaps() {
  const context = useContext(MapContext);

  if (context === undefined)
    throw Error("useMaps was defined outside the MapProvider");
  return context;
}

export { MapProvider, useMaps };
